import React from "react";
import './banner.css';

function Banner() {
    return (
        <div className="banner">
            <div className="banner-content">
                <div className="left-text">
                    <h1>Sobre Nossa Empresa</h1>
                    <p></p>
                </div>
                <div className="right-text">
                    <h1></h1>
                    <p></p>
                </div>
            </div>
        </div>
    );
}

export default Banner;
